		edition:'Nullboxer',color:'1b715f',
		ambula:'Ещё один микстейп из получившей дополнение пятой линейки. Как и в большей части предыдущих, звуковые композиции здесь были тщательно отобраны временем и лишь потом - руками автора этой кассеты (да, именно поэтому жанры слегка отличаются, такова идея, вложенная в микстейп). Задуманная атмосфера - настороженность, редкие мурашки по коже и погружение куда-то вглубь каскадов полуживых механизмов и металлических нагромождений.',
		fabula:'Говорят, что нет ничего более успокаивающего, чем тишина открытого космоса. Однако я был с этим не согласен - для настоящего члена скромного экипажа звездолёта тишина заключалась в его атмосфере. В едва ощутимой вибрации стен и низком гуле, исходившем из двигательного отсека; в тонком писке датчиков и индикаторов на приборной панели и лёгком свисте шлюзов и вентиляционной системы, гнавшей тысячекратно очищенный воздух по новому кругу. Двигались ли мы? Или, может, это космос летел нам навстречу? Я медленно спустился в рубку и сел в кресло. Я был один здесь, среди мерцающих в полутьме плеяд огоньков - свет был выкручен на минимум, как и полагается при затяжных полётах. Вахту несут только первую неделю, после остаются лишь капитан и штурман, а спустя ещё неделю и они уходят в хорошо защищённые капсулы гиперсна, убедившись в отсутствии ошибок в рассчитанной траектории полёта и в работе приборов. С этого момента вся ответственность перекладывается на автоматику - многократно продублированную, протестированную людьми и временем, но всё же автоматику. Впрочем, я не беспокоился - будучи штурманом, я прекрасно знал, что и как работает на корабле. "Эх, сколько же я налетал на этом пепелаце," - с некоторой тоской подумалось мне. Две, три, пять.. Мы побывали не менее, чем на восьми планетах, и это если не считать те, куда летали только за дозаправкой, высаживаясь на поверхность с орбитальной станции лишь по необходимости - обычно на них бывало всё, что нужно, от термофобного машинного масла и амулетов на удачу до lounge-баров с открытой витриной, демонстрирующей вид на поверхность планеты где-то под ногами (говорили, что так привычнее и комфортнее). Я потянулся за пультом и включил голопроектор. Вокруг меня выступила из пространства динамическая картинка туманной аллеи, ведущей к беседке. Тропинку из потрескавшегося асфальта обступал негустой лес, таявший в светлой дымке. Мимо невидимыми каплями зашелестел лёгкий дождь - в какой-то момент я даже ощутил каплю на лице и настороженно поднял голову, инстинктивно ожидая увидеть неприятную взору трещинку в какой-нибудь трубе в потолке, но тут же успокоился и погрузился в созерцание. Ветер шумел в тяжёлых кронах деревьев - я знал, что после дождя выступит солнце, и удивительно тонкие и острые, глубокого изумрудного цвета листья превратят эту лощину в зелёное море под знойным безоблачным небом. Но солнце никогда не выступало. Эта запись, некогда сделанная на родной планете этого корабля, всегда обрывалась, едва на небе начинали расступаться облака, как бы символизируя последний момент утра, перетёкшего в день. Когда-то эта красивейшая из планет дала имя этому кораблю - "Звёздный скиталец", и позже злые языки шутили, мол, неспроста - как корабль назывёшь, так он и полетит, и что именно это название предрешило его судьбу - быть действительно последним звездолётом этого класса, собранным на планете, тысячами осколков разлетевшейся в астероидное кольцо после последней войны,.. быть обречённым вечно искать свой дом. Мерный шум двигателей убаюкивал, и пока часть сознания следила за звуковыми регулярами приборов, оставшаяся погрузилась в дремоту и видела сны - странные, местами страшные, местами яркие, как реальность, сны о новой планете...',
